import React from 'react'
import './Button.css'

const Button = ({imp, text, link}) => {
    return (
        <div className = {`button ${imp === 'secondary' ? 'button__white' :''}`}>
            <a href={link} style="text-align: center;">{text}</a>

        </div>
    )
}

export default Button
